import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './Components/Navbar';
import Home from './Components/pages/Home';
function App() {
  return (
    <>
    <Router>
      <Navbar />
      <img src={logo} alt=" " />
      <Routes>
        <Route path='/' exact component={Home} />
      </Routes>

    </Router>
    </>
  );
}

export default App;
